import React from 'react';

const VideoItem = ({ videp }) => {
  return (
    <iframe
      key={video.id.videoId}
      width="420"
      height="315"
      src={`https://www.youtube.com/embed/` + video.id.videoId}
    />
  );
};

export default VideoItem;
